import * as React from 'react';
import { View, Text, Button, StyleSheet } from 'react-native';
import FontAwesome5, { FA5Style } from 'react-native-vector-icons/FontAwesome5';

export default class Iletisim extends React.Component {

    render() {
        const { navigation } = this.props;
        return (
            <View style={styles.container}>
                <View style={styles.row}>
                    <FontAwesome5 name='map-marker-alt' size={20} />
                    <Text>
                        Notifications Screen
                    </Text>
                </View>
                <View style={styles.row}>
                    <FontAwesome5 name='map-marked-alt' size={20} />
                    <Text>
                        Notifications Screen
                    </Text>
                </View>
                <View style={styles.row}>
                    <FontAwesome5 name='phone' size={20} />
                    <Text>
                        Notifications Screen
                    </Text>
                </View>
                <View style={styles.row}>
                    <FontAwesome5 name='whatsapp' size={20} />
                    <Text>
                        Notifications Screen
                    </Text>
                </View>
                <Button onPress={() => navigation.goBack()} title="Ana Sayfa" />
            </View>
        );
    }
}

const styles = StyleSheet.create({
    container: { flex: 1, justifyContent: 'center', alignItems: 'center' },
    row: { flexDirection: 'row', justifyContent: 'center', alignItems: 'center', margin: '20px' },
});
